import React from "react";
import jsyaml from "js-yaml";
import konumlarYaml from "src/konumlar.yaml";

class Konumlar extends React.Component {
  state = {
    konumlar: [],
  };

  componentDidMount() {
    const konumlar = jsyaml.load(konumlarYaml);
    this.setState({ konumlar });
  }

  render() {
    const { konumlar } = this.state;

    return (
      <div>
        <h1>Konumlar</h1>
        <ul>
          {konumlar.map((konum, index) => (
            <li key={index}>{konum}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Konumlar;
